import React from 'react';
import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';
import TextField from '@material-ui/core/TextField';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import MenuItem from '@material-ui/core/MenuItem';

export default function TransInfo () {
    const classes = selectStyle();
    const [CountryCode, setCountryCode] = React.useState('');
    const handleChange = (event) => {
      setCountryCode(event.target.value);
    };
    return (
        <React.Fragment>
            <Grid container spacing={3}>
                <Grid item xs={12} sm={6}>
                    <FormControl variant="outlined">
                        <Select labelId="country-code-label" id="country-code" 
                        value={CountryCode} onChange={handleChange} displayEmpty 
                        inputProps={{ 'aria-label': 'Without label' }}
                        classes={{ root: classes.root, option: classes.option, }}>
                            <MenuItem value="" disabled>Select</MenuItem>
                            <MenuItem value={1}>BTC</MenuItem>
                            <MenuItem value={2}>ETH</MenuItem>
                        </Select>
                    </FormControl>
                </Grid>
            </Grid>
            <Grid container spacing={3}>
                <Grid item xs={12} sm={6}>
                    <TextField
                        required
                        id="amount"
                        name="amount"
                        fullWidth
                        placeholder="ex: 0.347895"
                    />
                </Grid>
            </Grid>
        </React.Fragment>
    );
}
